@imetatronink The interesting thing is that #Kherson, while being evacuated will still be under artillery range. 
So the #Ukraine troops will find it tough to walk in and take control without losing a lot of men.
Unless there's a deal which allows #Russia to retreat &amp; #ukraine to advance

@McFaul Is Putin paying a significant price at home for the losses he and his forces are experiencing in Ukraine? 

If not, what will persuade him to alter his behavior and focus on other endeavors? 

Are there diplomatic initiatives, for example, that might now prove effective?
